import React from 'react';
import '../DeliveryCollection/DeliveryCollectionsStyles.css';
import NextArrow from '../../Carousal/nextArrow';
import PrevArrow from '../../Carousal/prevArrow';
import Slider from 'react-slick';
import DeliveryItem from './DeliveryItem/deliveryItem';

const deliveryItem = [
    {
        id: 1,
        title: "Daily Specials",
        cover: "https://bobstacos.com/wp-content/uploads/2022/06/daily-specials-6-22-22.jpg"
    },
    {
        id: 2,
        title: "Family Meal Deals",
        cover: "https://bobstacos.com/wp-content/uploads/2022/06/FINAL_FAMILY-MEALDEALS-06-24-2022-PNG.png"
    },
    {
        id: 3,
        title: "Cafe Menu",
        cover: "https://bobstacos.com/wp-content/uploads/2022/06/menu-20220626.png"
    },
    {
        id: 4,
        title: "Rajasthani Food", 
        cover: "https://wp.scoopwhoop.com/wp-content/uploads/2014/09/5677315b6e510a6f3a759a81_1.jpg"
    },
    {
        id: 5,
        title:  "American Food",
        cover: "https://i.ndtvimg.com/i/2015-07/burger-625_625x350_51435922877.jpg"
    },
    {
        id: 6,
        title: "Chinese Food",
        cover: "https://www.hotelmousai.com/blog/wp-content/uploads/2021/12/Chow-Mein.jpg"
    },
]

const settings = {
    infinite: true,
    speed: 500,
    slidesToShow: 3,
    slidesToScroll: 1,
    nextArrow: <NextArrow />,
    prevArrow: <PrevArrow />,
};

const DeliveryCollections = () => {
  return (
    <div className='delivery-collection'>
         <div className='max-width'>
            <div className='collection-title'>
                <h1>Menu & Spesials </h1>

                <Slider {...settings}>
                    {
                        deliveryItem.map((item)=>{
                            return <DeliveryItem  item={item} key={item.id}/>
                        })
                    }
                </Slider>
            </div>
         </div>
    </div>
  )
};

export default DeliveryCollections;
